import React from 'react';
import Navbar from 'react-bootstrap/Navbar';
import Container from 'react-bootstrap/Container';
import Button from 'react-bootstrap/Button';
import Dropdown from 'react-bootstrap/Dropdown';
import DropdownButton from 'react-bootstrap/DropdownButton';
import Nav from 'react-bootstrap/Nav';
import Logo from '../plantilla/img/logo.png'

class MMenu1 extends React.Component {
	render(){
		return(
			<div className="main_menu">
				<Navbar className="navbar navbar-expand-lg navbar-light main_box">
					<Container>
						<Nav.Link className="navbar-brand logo_h">
							<img src={Logo} alt=""/>
						</Nav.Link>
						<Nav className="navbar-toggler">
							Hola
						</Nav>

					</Container>
				</Navbar>
			</div>

		)
	}
}
export default MMenu1;
